import React from 'react';
import styled from 'styled-components';


function App() {
	return (
		<div className="App">
			<Menu></Menu>
			<StyledDiv>
				<StyledBtn as="a" href="#">Link</StyledBtn>
				<StyledBtn as={Link} href="#">Link-Link</StyledBtn>

				<StyledBtn>Hello</StyledBtn>
				<NewBtn>Yappp!</NewBtn>
			</StyledDiv>
		</div>
	);
}

export default App;

const StyledBtn = styled.button`
border:none;
background-color: rebeccapurple;
padding: 10px 20px;
border-radius: 5px;
color: aliceblue;
margin-right: 70px;

&:hover {
	background-color:red;
}
`

const NewBtn = styled(StyledBtn)`
	background-color: bisque;
	color: blueviolet;
`

const Link = styled(StyledBtn)`
	background-color: blue;
	color: burlywood;
`

const StyledDiv = styled.div`
	display: flex;
	align-items: center;
	justify-content: space-around;
	height: auto;

	button { //обращение к дочернему элементу
		cursor: pointer;
	}

	${Link} { //обращение к элементу внутри другого элемента
		cursor: zoom-in;
	}
`
